import Link from "next/link";
import styles from "./Nav.module.scss";

const BottomBar = (props) => {
  const {current} = props;
  return(
  <div className= {styles.nav} >
    <div className={styles.nav_wrapper}>
    <button id="book" className={styles.nav_button ` ${current==''? 'current': ''}`}><a href='http://www.secure-booker.com/angelamichael/MakeAppointment/Search.aspx'>Book</a></button>
    <button id="home" className={styles.nav_button ` ${current=='home'? 'current': ''}`}><Link href='/'>Home</Link></button>
    <button id="blog" className={styles.nav_button ` ${current=='blog'? 'current': ''}`}><Link href='/posts'>Blog</Link></button>
    </div>
  </div>
  )
};

export default BottomBar;

